import { useNavigate,useParams} from "react-router-dom";
import {useEffect,useState} from "react";
import { useWorkoutsContext } from "./hooks/useWorkoutsContext";


const Ex = () => {
    const {id } = useParams();
    const navigate = useNavigate();
    const {dispatch} = useWorkoutsContext();
    const [workout,setWorkout] = useState();
    useEffect(()=>{
      const fetchWorkouts = async () =>{
        const response = await fetch('/nat/workouts/' + id)
        const json = await response.json()


        if(response.ok){
            setWorkout(json);
            //dispatch({type: 'SET_WORKOUTS',payload: json})
        }
      }

    fetchWorkouts()
    },[id])
    const handleClick = async () =>{
        const response = await fetch('/nat/workouts/' + workout._id,{
            method: 'DELETE'
        })
        const json = await response.json()

        if(response.ok){
            dispatch({type: 'DELETE_WORKOUT',payload: json})
        }
    }
    const goBack = () =>{
        navigate(-1);
      }
    
    return ( <div className="Excersises">
        
            
           
            {workout && (
                
                <article>
                    <h2>{workout.date}</h2>
                    <h4> Workout type: {workout.type}</h4>
                    
                 
                    {workout.excersises.map(excersise =>(
                        <div className="excersises">
                            <p> <strong>{excersise[0]} </strong><br />
                            Excersise : {excersise[1]} <br />
                            Weight (lbs): {excersise[2]} <br />
                            Sets: {excersise[3]} <br />
                            Reps per Set: {excersise[4]}</p>
                            
                        </div>
                    ))}
                        
                    
                    
                    
                    <button onClick={handleClick}>Delete</button>
                </article>
        )}
    <button className='back' onClick={goBack}>Back</button>
    </div>);
}
 
export default Ex;
